window.bookSummaryJSON = "<p><b>You only live once...unless you’re resurrected to become the master of a dungeon.</b></p> <p>When Beno died and was offered a second chance as a dungeon core, he dived right in. He joined the dungeon core academy, and he found himself in a new life, where killing heroes wasn’t just accepted, but encouraged. Under the tutelage of the academy overseers, he learned how to make dungeons filled with monsters and traps.</p> <p>Now, he has finally been given his own dungeon, and he must pass his final test: Either build a dungeon powerful enough to slay heroes, or fail and get smashed up into core dust.&nbsp;</p> <p>He will apply all his diabolical dungeon strategy to succeed, but what happens when an unexpected visitor walks into his lair?&nbsp;</p> <p>He used to live a normal life. Now, he builds dungeons, creates monsters, and uses them to fight loot-hungry heroes.</p>"; 
